import React from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview}) {


	return (
		<View>
			<Image
              	source={{
                width: 100,
                height: 100,
                uri: preview}}
              />
			<View>

				<Text>

				</Text>
			</View>
		</View>

		)
}

export default KatsItem;
